import { useEffect } from 'react';
// import jwt_decode from 'jwt-decode';
import { gapi } from 'gapi-script'
import './App.css';

function App() {
  useEffect(() => {
    gapi.load('auth2', () => {
      gapi.auth2.init().then(function(auth2) {
        // If the user is already signed in
        if (auth2.isSignedIn.get()) {
          var googleUser = auth2.currentUser.get();

          // Change user's profile information
          changeProfile(googleUser);
        }
      });
    })
    // gapi.load('client:auth2', () => {
    //   gapi.auth2.init({
    //     clientId: "312061660538-mh1j9ht2g4j25nre1s9n96vmak2sitqk.apps.googleusercontent.com",
    //     scope: ""
    //   })
    // })

    // console.log(gapi.auth2.getAuthInstance().isSignedIn.get())
    // console.log(gapi.auth2.getAuthInstance().currentUser)
  }, [])
  function onSignIn(googleUser) {
    var profile = googleUser.getBasicProfile();
    console.log('ID: ' + profile.getId()); // Do not send to your backend! Use an ID token instead.
    console.log('Name: ' + profile.getName());
    console.log('Image URL: ' + profile.getImageUrl());
    console.log('Email: ' + profile.getEmail()); // This is null if the 'email' scope is not present.
  }

  return (
    <div className="App">
      <div id='googleSignInDiv'></div>
      <button className="g-signin2" data-onsuccess="onSignIn">sign in</button>
    </div>
  );
}

export default App;
